package com.cyber.authing.domain.entity;import com.cyber.domain.entity.PagingEntity;import lombok.Data;import lombok.EqualsAndHashCode;import java.util.List;@Data@EqualsAndHashCode(callSuper = true)public class User extends PagingEntity {	/**企业ID*/	private Long enterpriseId;	/**企业名称*/	private String enterpriseName;	/**用户名称*/	private String name;	/**用户性别（0男 1女 2未知）*/	private Integer sex;	/**用户类型（0系统用户）*/	private Integer type;	/**用户邮箱*/	private String email;	/**手机号码*/	private String phone;	/**头像地址*/	private String avatar;	/**岗位信息*/	private List<UserPosition> positionInfo;	/**部门信息*/	private List<UserDept> userDeptInfo;	/**部门IDs*/	private List<Long> deptIds;	/**岗位IDs*/	private List<Long> positionIds;	/**登录账号*/	private String account;	/**密码，系统登录必选，第三方登录可空*/	private String password;}